'use strict';const form=document.querySelector(".signup form"),continueBtn=form.querySelector(".button input"),errorText=form.querySelector(".error-text");continueBtn.onclick=()=>{let a=new XMLHttpRequest;a.open("POST","php/signup.php",!0);a.onload=()=>{if(a.readyState===XMLHttpRequest.DONE&&200===a.status){let b=a.response;"success"==b?location.href="users.php":(errorText.textContent=b,errorText.style.display="block")}};let c=new FormData(form);a.send(c)};